import styles from "./ListSales.module.css";
import receipt from "../../assets/icons/receipt_black_24dp.svg";
import { useState } from "react";
import PaymentReceipt from "../PaymentReceipt/PaymentReceipt";

export default function ListSales({ sales }) {
  const [openModal, setOpenModal] = useState(false);
  return (
    <tr key={sales.id} className={styles.containerUserInfo}>
      <td className={styles.id}>{sales.id}</td>
      <td className={styles.name}>{sales.name}</td>
      <td className={styles.cpf}>{sales.cpf}</td>
      <td className={styles.email}>{sales.email}</td>

      <td className={styles.qtdItens}>{sales.qtdItens}</td>
      <td className={styles.value}>{sales.value}</td>
      <td className={styles.moneyChange}>{sales.moneyChange}</td>
      <td className={styles.receipt}>
        <button
          className={styles.receipt}
          onClick={() => {
            setOpenModal(true);
          }}
        >
          <PaymentReceipt
            open={openModal}
            onClose={() => {
              setOpenModal(true);
            }}
          />
          <img src={receipt} alt="receipt" />
        </button>
      </td>
    </tr>
  );
}
